window.bookSummaryJSON = "<p><b>From the world of Spellmonger...blessed darkness conceal her!</b></p> <p>Born into a mysterious family, Gatina always knew there was something special about those around her. But when the duke and duchess of Alshar - close friends of her family - are brutally assassinated, her idyllic countryside life is upended by secrets emerging from the shadows.</p> <p>The family she knew proved to be more than mere Alshari Coastlords and occasional magi, as she once believed. For centuries, her ancient and distinguished House has been secretly both Shadowmagi and highly skilled thieves. With a devious count seeking to capitalize on the assassination, the future stability and peace of Alshar hinges on Gatina learning both arts.</p> <p>Slavery and piracy loom malevolently in the distance as the Count allies himself with a merciless criminal organization to seize power.</p> <p>Gatina’s House has vowed to stand against the rising tide of wickedness - no matter how hopeless the task may seem. Working in secret beneath the tutelage of an enigmatic and mysterious master, Gatina finds herself disguised as a street orphan. She runs the filthy gutters of Falas as she puts her training into practice amid the dismal reality of its most destitute neighborhoods.</p> <p>Brutal thugs, violent riots, cunning soldiers, and the constant threat of discovery by the Count and his allies, all put Gatina’s life at risk as she struggles in secret against the rising tyrant. </p> <p>For as the blessed darkness conceals her movements by night, she and the Brotherhood engage in a clandestine struggle, something much more deadly than mere...shadowplay.</p>"; 
